import React from 'react';
import styles from './styles.css';
import { Top } from './Top';
import { Panel } from './Panel';

const LoginPage = () => {
    return (
        <React.Fragment>
            <Top />
            <Panel />
        </React.Fragment>
    );
}

export default LoginPage;
